column16:
Compraventa de elementos de dotación básica para los hogares sustitutos para la atención de niños; 
niñas; adolescentes con vulneración y/o amenaza y jóvenes con y sin discapacidad con ubicación en la modalidad 
de acogimiento en medio familiar- hogar sustitutos en la Regional Putumayo

